const tintColorLight = '#2f95dc';
const tintColorDark = '#fff';

export const colors = {
  nearByeBlue: '#0086A4',
  nearByePurple: '#240071',
  nearByeGreen: '#53C08C',
  nearByeRed: '#f15050'
};

export default {
  light: {
    text: '#000',
    background: '#fff',
    tint: tintColorLight,
    tabIconDefault: '#ccc',
    tabIconSelected: tintColorLight,
  },
  dark: {
    text: '#fff',
    background: '#000',
    tint: tintColorDark,
    tabIconDefault: '#ccc',
    tabIconSelected: tintColorDark,
  },
};
